        /// <summary>
        /// 随机生成身份证号码,出生年份为80年前至25年前,含80
        /// </summary>
        /// <returns>身份证号码</returns>
        public string randomIDNum()
        {
            //随机性别
            Random rd = new Random();
            int gender = rd.Next(2);

            //随机生日
            System.DateTime birthdayDT = this.getRandomDate(System.DateTime.Now.AddYears(-80), System.DateTime.Now.AddYears(-25));
            string birthday = birthdayDT.Year.ToString() + birthdayDT.Month.ToString("00") + birthdayDT.Day.ToString("00");

            //随机地区
            AreaCodeXml codeXml = new AreaCodeXml();
            string[] proList = codeXml.getProList();
            int proNo = rd.Next(proList.Length);
            string pro = proList[proNo];
            string[] cityList = codeXml.getCityList(pro);
            int cityNo = rd.Next(cityList.Length);
            string city = cityList[cityNo];
            string[] disList = codeXml.getDistrictList(pro, city);
            int disNo = rd.Next(disList.Length);
            string dis = disList[disNo];
            string areaCode = codeXml.getRegionCode(pro, city, dis);

            Report.Info(genIDNum(areaCode, birthday, gender));
            return genIDNum(areaCode, birthday, gender);
        }

        /// <summary>
        /// 随机生成身份证号码,可限定年龄范围
        /// </summary>
        /// <param name="min">年龄最小值(不含)</param>
        /// <param name="max">年龄最大值(含)</param>
        /// <returns>身份证号码</returns>
        public string randomIDNum(int min, int max)
        {
            //随机性别
            Random rd = new Random();
            int gender = rd.Next(2);

            //随机生日
            System.DateTime birthdayDT = this.getRandomDate(System.DateTime.Now.AddYears(-max), System.DateTime.Now.AddYears(-min));
            string birthday = birthdayDT.Year.ToString() + birthdayDT.Month.ToString("00") + birthdayDT.Day.ToString("00");

            //随机地区
            AreaCodeXml codeXml = new AreaCodeXml();
            string[] proList = codeXml.getProList();
            int proNo = rd.Next(proList.Length);
            string pro = proList[proNo];
            string[] cityList = codeXml.getCityList(pro);
            int cityNo = rd.Next(cityList.Length);
            string city = cityList[cityNo];
            string[] disList = codeXml.getDistrictList(pro, city);
            int disNo = rd.Next(disList.Length);
            string dis = disList[disNo];
            string areaCode = codeXml.getRegionCode(pro, city, dis);

            return genIDNum(areaCode, birthday, gender);
        }

        /// <summary>
        /// 根据地区出生日期性别生成身份证号码
        /// </summary>
        /// <param name="areaCode">行政区划代码</param>
        /// <param name="birthday">出生日期,格式:19000101</param>
        /// /// <param name="gender">性别,1为男，0为女</param>
        /// <returns>身份证号码</returns>
        public string genIDNum(string areaCode, string birthday, int gender)
        {
            int idLast3 = 0;
            do
            {
                idLast3 = rand.Next(1, 999);
            } while ((idLast3 % 2) != gender);
            string id17 = areaCode + birthday + idLast3.ToString("000");
            return id17 + this.calCheckCode(id17);
        }

        /// <summary>
        /// 15位身份证号转18位
        /// </summary>
        /// <param name="id">15位身份证号</param>
        /// <returns>身份证号码</returns>
        public string generate15To18(string id)
        {
            if (id.Length != 15)
                return id;
            id = id.Insert(6, "19");
            return id + this.calCheckCode(id.Substring(0, 17));
        }

        /// <summary>
        /// 随机生成日期
        /// </summary>
        /// <param name="min">年份最小值</param>
        /// <param name="max">年份最大值</param>
        /// <returns>日期</returns>
        public System.DateTime getRandomDate(System.DateTime min, System.DateTime max)
        {
            TimeSpan ts = new TimeSpan(max.Ticks - min.Ticks);
            int dayRand = rand.Next(1, ts.Days);
            return min.AddDays(dayRand);
        }

        /// <summary>
        /// 检查身份证号是否正确
        /// </summary>
        /// <param name="IDNum">身份证号</param>
        /// <returns>判断结果</returns>
        public bool checkIDNum(string IDNum)
        {
            AreaCodeXml codeXml = new AreaCodeXml();
            IDNum = this.generate15To18(IDNum);
            string msg;
            try
            {
                string regionName = codeXml.getRegionName(IDNum.Substring(0, 6));
                msg = null == regionName ? "地址码不能识别" : "地址：" + regionName;
                if (null == regionName) { return false; }

                System.DateTime dt = new System.DateTime();
                bool b = System.DateTime.TryParse(IDNum.Substring(6, 8).Insert(4, "-").Insert(7, "-"), out dt);
                int age = System.DateTime.Now.Year - dt.Year;
                msg += b ? "；年龄：" + age.ToString() : "；出生日期码不是日期格式";
                if (!b) { return false; }

                string valCode = this.calCheckCode(IDNum.Substring(0, 17));
                msg += IDNum.EndsWith(valCode) ? "" : "；第18位校验码为：" + valCode;
                if (!IDNum.EndsWith(valCode)) { return false; }

                return true;
            }
            catch (Exception)
            {
                return false;
            }

        }

        /// <summary>
        /// 计算校验码
        /// </summary>
        /// <param name="id17">身份证号前17位</param>
        /// <returns>完整身份证号</returns>
        public string calCheckCode(string id17)
        {
            int[] weight = { 7, 9, 10, 5, 8, 4, 2, 1, 6, 3, 7, 9, 10, 5, 8, 4, 2 };
            string[] validate = { "1", "0", "X", "9", "8", "7", "6", "5", "4", "3", "2" };
            int sum = 0;
            char[] id = id17.ToCharArray();
            for (int i = 0; i < 17; i++)
                sum += int.Parse(id[i].ToString()) * weight[i];
            int mod = sum % 11;
            return validate[mod];
        }

        /// <summary>
        /// 读取area_code.xml，获取省市区、地址码
        /// </summary>
        public class AreaCodeXml
        {
            readonly XmlDocument doc = new XmlDocument();
            readonly static string SPERCIAL_REGION = "台湾省香港特别行政区澳门特别行政区";
            readonly static string PRO_XPATH = "/areas/regionEntitys/region";
            readonly static string CITY_XPATH = PRO_XPATH + "[.='{0}']/../regionEntitys/region";
            readonly static string DISTRICT_XPATH = CITY_XPATH + "[.='{1}']/../regionEntitys/region";
            readonly static string CODE_XPATH = DISTRICT_XPATH + "[.='{2}']/preceding-sibling::code";

            /// <summary>
            /// 构造函数
            /// </summary>
            public AreaCodeXml()
            {
                doc.Load("./area_code.xml");
            }

            /// <summary>
            /// 获取地址码
            /// </summary>
            /// <param name="pro">省份</param>
            /// <returns>地址码</returns>
            public string getRegionCode(string pro)
            {
                string s = string.Format(PRO_XPATH + "[.='{0}']/preceding-sibling::code", pro);
                return doc.SelectSingleNode(s).InnerText;
            }

            /// <summary>
            /// 获取地址码
            /// </summary>
            /// <param name="pro">省份</param>
            /// <param name="city">地级行政区划</param>
            /// <returns>地址码</returns>
            public string getRegionCode(string pro, string city)
            {
                if (SPERCIAL_REGION.Contains(pro))
                    return this.getRegionCode(pro);
                string s = string.Format(CITY_XPATH + "[.='{1}']/preceding-sibling::code", pro, city);
                return doc.SelectSingleNode(s).InnerText;
            }

            /// <summary>
            /// 获取地址码
            /// </summary>
            /// <param name="pro">省份</param>
            /// <param name="city">地级行政区划</param>
            /// <param name="district">县级行政区划</param>
            /// <returns>地址码</returns>
            public string getRegionCode(string pro, string city, string district)
            {
                if (SPERCIAL_REGION.Contains(pro))
                    return this.getRegionCode(pro);
                string s = string.Format(CODE_XPATH, pro, city, district);
                return doc.SelectSingleNode(s).InnerText;
            }

            /// <summary>
            /// 获取地址
            /// </summary>
            /// <param name="code">地址码</param>
            /// <returns>地址</returns>
            public string getRegionName(string code)
            {
                XmlNode d = doc.SelectSingleNode(string.Format("//code[.='{0}']/following-sibling::region", code));
                XmlNode c = doc.SelectSingleNode(string.Format("//code[.='{0}']/../../region", code));
                XmlNode p = doc.SelectSingleNode(string.Format("//code[.='{0}']/../../../region", code));
                return null == d ? null : p.InnerText + c.InnerText + d.InnerText;
            }

            /// <summary>
            /// 获取省直辖市特区列表
            /// </summary>
            /// <returns>省级列表</returns>
            public string[] getProList()
            {
                return this.getRegionNodesList(PRO_XPATH).ToArray();
            }

            /// <summary>
            /// 获取市列表
            /// </summary>
            /// <param name="pro">省份</param>
            /// <returns>地级列表</returns>
            public string[] getCityList(string pro)
            {
                List<string> citys = new List<string>();
                if (SPERCIAL_REGION.Contains(pro))
                    citys.Add(pro);
                else
                    citys = this.getRegionNodesList(string.Format(CITY_XPATH, pro));
                return citys.ToArray();
            }

            /// <summary>
            /// 获取区列表
            /// </summary>
            /// <param name="pro">省份</param>
            /// /// <param name="city">地级行政区划</param>
            /// <returns>县级列表</returns>
            public string[] getDistrictList(string pro, string city)
            {
                List<string> districts = new List<string>();
                if (SPERCIAL_REGION.Contains(pro))
                    districts.Add(pro);
                else
                    districts = this.getRegionNodesList(string.Format(DISTRICT_XPATH, pro, city));
                return districts.ToArray();
            }

            //获取xml所有xpath节点的innertext
            private List<string> getRegionNodesList(string xpath)
            {
                XmlNodeList nodes = doc.SelectNodes(xpath);
                List<string> list = new List<string>();
                foreach (XmlNode n in nodes)
                {
                    list.Add(n.InnerText);
                }
                return list;
            }
        }
    }
